frontApp.controller("categoryProductController",["$scope","$http","$window","CategoryProduct",function(n,t,i,r){n.categoryProducts=[];n.products=[];n.idCategoryProduct=angular.element("#idCategoryProduct").val();t.get("/API/CategoryProductsAPI/").success(function(t){var i=r.getallCategoryProduct(t);angular.forEach(i,function(t){t.idCategoryProductParent=="1"&&n.categoryProducts.push(t)})});t.get("/API/ProductsAPI/").success(function(t){angular.forEach(t,function(t){t.idCategoryProduct==n.idCategoryProduct&&n.products.push(t)})})}]);